@everyone - If you are participating in the GF180MCU Run #1 shuttle, please make sure you have created your project on both https://test-platform.wafer.space (and the soon to exist https://platform.wafer.space) with identical project name ASAP! 

Doing so will allow me to transfer files & precheck runs between the two systems and potentially allow up to 6 precheck runs happen in parallel.

*If* you are expecting a free slot, please make sure your project exists and I have your email address so I can cross check the final slot count and usage.

@Leo Moser (mole99) 
Is there an antenna rule DRC checker?
Our GDS is analog circuitry, so it's highly likely to have antenna rule violations. Therefore, we want to check it as soon as possible.
